import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  
    const item1 = {
    title: props[0].title,
    amount: props[0].amount,
    date: props[0].date
  }

  return (
    <div className="expenses">
      <ExpenseItem
        title={item1.title}
        amount={item1.amount}
        date={item1.date}
      />
    </div>
  );
}

export default Expenses;
